import React from "react";
import PostList from "../component/postList";
import PlanInfo from "../component/plan_info";
import PlanBanner from "../component/plan_banner";
import '../css/Main.css';

const Main = () => {
    const [positions, setPositions] = useState([]);


    return (
        <React.Fragment>
            <PlanInfo setPositions={setPositions} />
            <div className="post_list">
                <PostList />
            </div>
            <div className="my_plan_banner">
                <PlanBanner positions={positions} />
            </div>
        </React.Fragment>
    )
}

export default Main;
